import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { SignupService } from 'src/app/services/signup.service';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.css']
})
export class SignupComponent {

  constructor(private service:SignupService,private router:Route){}
fullName: any;
username: any;
email: any;
phone: any;
password: any;
gender: any;

addUser() {
  this.service.addUser(this.fullName,this.username,
    this.email,this.phone,this.password,this.gender).
    subscribe((response)=>{
      console.log(response)
      this.router.navigate(['menu'])
    })
  }

}
